import React from "react";

import {
    CssClasses
} 
from "../utilities";

const previewer = props => {
    const classes = new CssClasses("bg-light");

    const styles = {
        paddingLeft: "0.75rem",
        paddingRight: "0.75rem",
        paddingTop: "0.375rem",
        paddingTop: "0.375rem"
    };

    return (
        <div className={classes.toString()} style={styles}>
            {props.children}
        </div>
    );
}
export default previewer;
